fields.formula:
concat( 
  "OBJ", 
  if( 
    row_id() < 10, 
    concat("0000", row_id()), 
    if( 
      row_id() < 100, 
      concat("000", row_id()), 
      if( 
        row_id() < 1000, 
        concat("00", row_id()), 
        if( 
          row_id() < 10000, 
          concat("0", row_id()), 
          row_id() 
        ) 
      ) 
    ) 
  ) 
)

if( 
  or( 
    isblank(join(field("Related key results"), "")), 
    length(join(field("Related key results"), "")) < 1 
  ), 
  "N/A", 
  count(field("Related key results")) 
)

round( 
  avg( 
    filter( 
      lookup("Related key results", "Progress status (%)"), 
      and( 
        totext(lookup("Related key results", "Status")) != "New", 
        totext(lookup("Related key results", "Status")) != "Cancelled" 
      ) 
    ) 
  ), 
  2 
)

if( 
  or( 
    isblank(join(field("Related key results"), "")), 
    length(join(field("Related key results"), "")) < 1 
  ), 
  "", 
  if( 
    any(totext(lookup("Related key results", "Status")) = "Missed"), 
    "❌ Missed", 
    if( 
      every(totext(lookup("Related key results", "Status")) = "Cancelled"), 
      "✂️ Cancelled", 
      if( 
        every(totext(lookup("Related key results", "Status")) = "On hold"), 
        "🥶 On hold", 
        if( 
          or( 
            every(totext(lookup("Related key results", "Status")) = "Completed"), 
            avg(lookup("Related key results", "Progress status (%)")) = 100 
          ), 
          "🏆 Achieved", 
          if( 
            or( 
              every(totext(lookup("Related key results", "Status")) = "In progress"), 
              avg(lookup("Related key results", "Progress status (%)")) > 0 
            ), 
            "⏳ In progress", 
            if( 
              every(totext(lookup("Related key results", "Status")) = "New"), 
              "💡 New", 
              if( 
                every(totext(lookup("Related key results", "Status")) = "Scheduled"), 
                "📆 Scheduled", 
                if( 
                  any(totext(lookup("Related key results", "Status")) = "Scheduled"), 
                  "📆 Scheduled", 
                  "💡 New" 
                ) 
              ) 
            ) 
            ) 
          ) 
      ) 
    ) 
  ) 
)

concat( 
  "KR", 
  if( 
    row_id() < 10, 
    concat("0000", row_id()), 
    if( 
      row_id() < 100, 
      concat("000", row_id()), 
      if( 
        row_id() < 1000, 
        concat("00", row_id()), 
        if( 
          row_id() < 10000, 
          concat("0", row_id()), 
          row_id() 
        ) 
      ) 
    ) 
  ) 
)

join( 
  if( 
    or( 
      trunc(tonumber(right(totext(field("Objective ID")), 1))) = 1, 
      trunc(tonumber(right(totext(field("Objective ID")), 1))) = 6 
    ), 
    "S", 
    if( 
      or( 
        trunc(tonumber(right(totext(field("Objective ID")), 1))) = 2, 
        trunc(tonumber(right(totext(field("Objective ID")), 1))) = 7 
      ), 
      "Y", 
      if( 
        or( 
          trunc(tonumber(right(totext(field("Objective ID")), 1))) = 3, 
          trunc(tonumber(right(totext(field("Objective ID")), 1))) = 8 
        ), 
        "G", 
        if( 
          or( 
            trunc(tonumber(right(totext(field("Objective ID")), 1))) = 4, 
            trunc(tonumber(right(totext(field("Objective ID")), 1))) = 9 
          ), 
          "R", 
          "B" 
        ) 
      ) 
    ) 
  ), 
  "" 
)

concat( 
  "U", 
  if( 
    row_id() < 10, 
    concat("0000", row_id()), 
    if( 
      row_id() < 100, 
      concat("000", row_id()), 
      if( 
        row_id() < 1000, 
        concat("00", row_id()), 
        if( 
          row_id() < 10000, 
          concat("0", row_id()), 
          row_id() 
        ) 
      ) 
    ) 
  ) 
)

join( 
  if( 
    or( 
      trunc(tonumber(right(totext(field("Key result ID")), 1))) = 1, 
      trunc(tonumber(right(totext(field("Key result ID")), 1))) = 6 
    ), 
    "S", 
    if( 
      or( 
        trunc(tonumber(right(totext(field("Key result ID")), 1))) = 2, 
        trunc(tonumber(right(totext(field("Key result ID")), 1))) = 7 
      ), 
      "Y", 
      if( 
        or( 
          trunc(tonumber(right(totext(field("Key result ID")), 1))) = 3, 
          trunc(tonumber(right(totext(field("Key result ID")), 1))) = 8 
        ), 
        "G", 
        if( 
          or( 
            trunc(tonumber(right(totext(field("Key result ID")), 1))) = 4, 
            trunc(tonumber(right(totext(field("Key result ID")), 1))) = 9 
          ), 
          "R", 
          "B" 
        ) 
      ) 
    ) 
  ), 
  "" 
)

avg( 
  filter( 
    lookup("Related objectives", "Progress status (%)"), 
    and( 
      isblank(lookup("Related objectives", "Status")) = False, 
      and( 
        contains(totext(lookup("Related objectives", "Status")), "Cancelled") = False, 
        and( 
          contains(totext(lookup("Related objectives", "Status")), "New") = False, 
          contains(totext(lookup("Related objectives", "Status")), "Scheduled") = False 
        ) 
      ) 
    ) 
  ) 
)
